INSERT INTO `product` VALUES ('9', '2', '对于 MacBook，我们给自己设定了一个几乎不可能实现的目标：在有史以来最为轻盈纤薄的 Mac 笔记本电脑上，打造全尺寸的使用体验。这就要求我们不仅要令其更为纤薄轻巧，还要更加出色。在新款 MacBook 上，我们新配备了第七代 Intel Core m3、i5 和 i7 处理器，使处理性能提升最高可达 20%1，此外还采用了速度提升最高可达 50% 的固态硬盘存储2。', '/mall/admin/product/img/1.jpg', '1', '13888', '2018-06-06 13:56:02', '12000', '\r\n苹果 (Apple） 2016新款 MacBook Pro 苹果笔记本电脑 15英寸Bar/i7/16G/256G/灰/H32', null);
INSERT INTO `product` VALUES ('10', '11', 'iPhone X\r\n一直以来，我们都心存一个设想，期待着能够打造出这样一部 iPhone：它有整面的屏幕，能让你在使用时完全沉浸其中，仿佛忘记了它的存在。它是如此智能，你的一触、一碰、一言、一语，哪怕是轻轻一瞥，都会得到它心有灵犀的回应。而这个设想，终于随着 iPhone X 的到来成为了现实。现在，就跟未来见个面吧。\r\n\r\n', '/mall/admin/product/img/2.jpg', '1', '8799', '2018-06-06 14:02:29', '7500', 'Apple 苹果 iPhone X 手机 深空灰色 全网通 256GB', null);
INSERT INTO `product` VALUES ('11', '2', '交给新款 iPad Pro 的大小任务，它都能漂亮完成，甚至还游刃有余。它的强大性能会让许多笔记本电脑都羡慕不已，可用起来又是那么轻松愉悦。新设计的视网膜显示屏，不仅看着令人惊艳，触控时更能给人惊喜。而所有这一切，都与先进的移动操作系统 iOS 携手而来。iPad Pro 能做到的，不仅是满足你对当今电脑的种种所需，而且还能超越预期。', '/mall/admin/product/img/3.jpg', '1', '2788', '2018-06-06 14:05:22', '2400', 'Apple iPad 平板电脑 9.7英寸（128G WLAN版/A9 芯片/Retina显示屏/Touch ID技术 MPGW2CH/A）金色', null);
INSERT INTO `product` VALUES ('12', '13', '放开跑。\r\n全球两大创意品牌一路并肩合作，让这款跨界之作更进一步。有了内置的蜂窝网络支持，Apple Watch Nike+ 能让你在训练时听到近在耳边的教练语音指导，在线聆听喜欢的音乐，还能接收通知消息，即使没带手机也没问题。你的跑步好搭档变得更合拍了。', '/mall/admin/product/img/13.jpg', '1', '2318', '2018-06-06 14:08:52', '1800', 'Apple Watch Series 3 苹果运动智能手表3代 GPS蜂窝电话手环', null);
INSERT INTO `product` VALUES ('13', '11', '这是发现美的眼睛，这是深藏智慧的目光\r\n不只契合你的向往\r\n更能创造你的惊叹\r\nHUAWEI P20系列，为你而来.技术的创新，推动艺术的进步。借助HUAWEI P20 Pro的突破性变革，你可以轻松成为摄影大师。\r\n革命性的徕卡三镜头和AI人工智能芯片，让创作变得更加简单。\r\n带上HUAWEI P20 Pro，发现无处不在的美。', '/mall/admin/product/img/4.jpg', '1', '5488', '2018-06-06 14:11:00', '4700', '华为（HUAWEI） 华为P20Pro手机 宝石蓝 全网通(6GB+128GB)', null);
